'use strict';

const heredoc = function(fn) {
  return ('' + fn).match(/[^]*\/\*([^]*)\*\/\}$/)[1];
};

const disableAllStyleSheets = function() {
  for (let i = 0; i < document.styleSheets.length; i++) {
    document.styleSheets[i].disabled = true;
  }
};

